import { BrowserRouter, Route, Routes } from 'react-router';
import React from 'react'
import { Navbar } from './Components/Navbar';
import Home from'./pages/Home'
function  App () {
  return (
    <div>
      <Navbar />
      <Routes>
         <Route path='/home' element={<Home />} />

      </Routes>
    </div>
  );
}

export default App
